import './App.css';
import ClientCrud from '../components/clients/ClientCrud'
import { BrowserRouter, Route, Router } from 'react-router-dom'

const rootElement = document.getElementById("root");
render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<ClientCrud />} />
    </Routes>
  </BrowserRouter>,
  rootElement
);

export default App;
